BEGIN TRANSACTION;
DROP TABLE IF EXISTS `personft`;
CREATE TABLE IF NOT EXISTS `personft` (
	`idpersonft`	int,
	`nama`	text,
	`tgl_tes`	date,
	`jenis_kelamin`	text,
	`tgl_lahir`	date,
	`asal_sekolah`	text,
	`jurusan`	text,
	`kota`	text,
	`hobi`	text,
	`prestasi_akademik`	text,
	`prestasi_non`	akademik text,
	`eksul`	text,
	PRIMARY KEY(`idpersonft`)
);
DROP TABLE IF EXISTS `personfs`;
CREATE TABLE IF NOT EXISTS `personfs` (
	`idpersonfs`	int,
	`no_tes`	int,
	`tgl_tes`	date,
	`nama_kandidat`	text,
	`jenis_kelamin`	text,
	`tgl_lahir`	date,
	`pendidikan_terakhir`	text,
	`jurusan`	text,
	`kota`	text,
	`perusahaanorinstansi`	text,
	`posisiorjabatan`	text,
	PRIMARY KEY(`idpersonfs`)
);
DROP TABLE IF EXISTS `kuncijawaban`;
CREATE TABLE IF NOT EXISTS `kuncijawaban` (
	`idkuncijawaban`	int,
	`personfsid`	int,
	`personftid`	int,
	FOREIGN KEY(`personfsid`) REFERENCES `personfs`(`idpersonfs`),
	FOREIGN KEY(`personftid`) REFERENCES `personft`(`idpersonft`),
	PRIMARY KEY(`idkuncijawaban`)
);
DROP TABLE IF EXISTS `fileedit`;
CREATE TABLE IF NOT EXISTS `fileedit` (
	`Profesi`	TEXT,
	`Code`	TEXT
);
DROP TABLE IF EXISTS `databasekandidat2`;
CREATE TABLE IF NOT EXISTS `databasekandidat2` (
	`Nama`	TEXT,
	`TanggalTes`	TEXT,
	`JenisKelamin`	TEXT,
	`TanggalLahir`	TEXT,
	`AsalSekolah`	TEXT,
	`Jurusan`	TEXT,
	`AsalUniversitas`	TEXT,
	`Jurusan2`	TEXT,
	`Kota`	TEXT,
	`Hobi`	TEXT,
	`PrestasiAkademik`	TEXT,
	`PrestasiNonAkdemik`	TEXT,
	`EkskulYangDiikuti`	TEXT
);
DROP TABLE IF EXISTS `databasekandidat`;
CREATE TABLE IF NOT EXISTS `databasekandidat` (
	`NoTes`	TEXT,
	`TanggalTes`	TEXT,
	`NamaKandidat`	TEXT,
	`JenisKelamin`	TEXT,
	`TanggalLahir`	TEXT,
	`PendidikanTerakhir`	TEXT,
	`Jurusan`	TEXT,
	`Kota`	TEXT,
	`Perusahaan/Instansi`	TEXT,
	`Posisi/Jabatan`	TEXT
);
COMMIT;
